// src/SelectTimePage.js
import React, { useState } from 'react';

const SelectTimePage = () => {
  const [preferredTime, setPreferredTime] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();
    alert(`Preferred notification time: ${preferredTime}`);
    // Send preferredTime to your backend API
  };

  return (
    <div className="SelectTimePage">
      <h2>Select Your Preferred Notification Time</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Enter your preferred time:
          <input
            type="time"
            value={preferredTime}
            onChange={(e) => setPreferredTime(e.target.value)}
            required
          />
        </label>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default SelectTimePage;
